import React from 'react';
import Link from 'react-router-dom';

const Portfolioitem = props => {
	const styles = {
		backgroundImage: `url(${props.backgroundImageURL})`
	};

	const ItemID = () => {
		if (props.id <= 9) {
			return '0' + props.id;
		} else {
			return props.id;
		}
	};

	return (
		<div className="portfolio-item " style={styles}>
			<span className="prev-item">
				<ItemID />
			</span>

			<p>{props.name}</p>
			<p className="portfolio-link-to-item">
				<a href={props.link}>WiÄ™cej</a>
			</p>
			<Link to="www.google.pl" className="next-item">
				<ItemID />
			</Link>
		</div>
	);
};

export default Portfolioitem;
